import React, {Component} from 'react';

class Timeline extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
            <div className="p-grid p-fluid">

            <div className="p-col-12 p-lg-6">
                <div className="card">
                    <video src="https://www.youtube.com/watch?v=_V4r5ibOm5g&list=LLkdJNcMKlxTMjrXzSMoKzjg&index=51&t=32s ">
                        Timeline
                    </video>
                </div>
            </div>
            <div className="p-col-12 p-lg-12">
                <div className="card">
                    <a 
                        href="https://youtu.be/_V4r5ibOm5g " 
                        target="_blank" 
                        rel="noopener noreferrer">
                        <i className='fas fa-play' style={{marginRight: '10px'}}/> 
                        Timeline da covid-19
                    </a>
                </div>
            </div>
            </div>
         ); 
    }
}

export default Timeline;
